function AuthForm(props) {
    return (
        <div className="container d-flex flex-column justify-content-center align-items-center">
        <div>Привет, {props.currentUser}!</div>
            <div className="input-group mb-3">
                <input type="text" className="form-control" placeholder="Номер комнаты" aria-label="Номер комнаты" aria-describedby="button-addon2"></input>
                <button className="btn btn-outline-primary" type="button" id="button-addon2">Войти</button>
            </div>
        <span>or</span>
        <div className="row">
                <button className="btn btn-outline-primary" type="button" id="button-addon2">Создать комнату</button>
        </div>
        </div>
    )
  }
  
  export default AuthForm;
